import './App.css';

function App() {
  return (
    <div>
      <header>
        <a className='menu'>-_-</a>
        <div className='location'>Banning</div>
        <div className='temp'>C°/F°</div>
      </header>
      <div className='main'>
        <div className='icon'>
          <img src='http://openweathermap.org/img/wn/02d@2x.png'/>
        </div>
      </div>
    </div>
  );
}

export default App;
